"use strict";(self.webpackChunkklipper_docs=self.webpackChunkklipper_docs||[]).push([["381"],{94928:function(e,n,t){t.r(n),t.d(n,{frontMatter:()=>s,default:()=>p,contentTitle:()=>a,assets:()=>l,toc:()=>c,metadata:()=>r});var r=JSON.parse('{"id":"ProductDoc/ToolBoard/fly-sht36/sht36_v2/cfg","title":"cfg","description":"Please do not modify the configuration while web page translation is enabled.","source":"@site/i18n/en/docusaurus-plugin-content-docs/current/ProductDoc/ToolBoard/fly-sht36/sht36_v2/cfg.mdx","sourceDirName":"ProductDoc/ToolBoard/fly-sht36/sht36_v2","slug":"/ProductDoc/ToolBoard/fly-sht36/sht36_v2/cfg","permalink":"/fly-docs-next/en/docs/ProductDoc/ToolBoard/fly-sht36/sht36_v2/cfg","draft":false,"unlisted":false,"editUrl":"https://github.com/kluoyun/fly-docs-next/tree/master/docs/ProductDoc/ToolBoard/fly-sht36/sht36_v2/cfg.mdx","tags":[],"version":"current","lastUpdatedBy":"xishangyue","lastUpdatedAt":1746004502000,"sidebarPosition":5,"frontMatter":{"sidebar_position":5,"sidebar_label":"Configuration Reference"},"sidebar":"tutorialSidebar","previous":{"title":"Wiring Reference","permalink":"/fly-docs-next/en/docs/ProductDoc/ToolBoard/fly-sht36/sht36_v2/wiring"},"next":{"title":"Accelerometer Usage","permalink":"/fly-docs-next/en/docs/ProductDoc/ToolBoard/fly-sht36/sht36_v2/adxl"}}'),o=t(85893),i=t(50065);let s={sidebar_position:5,sidebar_label:"Configuration Reference"},a="Reference Configuration",l={},c=[];function d(e){let n={admonition:"admonition",code:"code",h1:"h1",header:"header",p:"p",pre:"pre",...(0,i.a)(),...e.components};return(0,o.jsxs)(o.Fragment,{children:[(0,o.jsx)(n.admonition,{type:"tip",children:(0,o.jsx)(n.p,{children:"Please do not modify the configuration while web page translation is enabled."})}),"\n",(0,o.jsx)(n.admonition,{title:"Note",type:"warning",children:(0,o.jsx)(n.p,{children:"Please do not modify the configuration while web page translation is enabled."})}),"\n",(0,o.jsx)(n.admonition,{title:"Notice",type:"danger",children:(0,o.jsx)(n.p,{children:"Please do not modify the configuration while web page translation is enabled."})}),"\n",(0,o.jsx)(n.header,{children:(0,o.jsx)(n.h1,{id:"reference-configuration",children:"Reference Configuration"})}),"\n",(0,o.jsx)(n.pre,{children:(0,o.jsx)(n.code,{className:"language-cfg",children:'#####################################################################\n#      Notes\n#####################################################################\n## Please add [include sht36v2.cfg] under printer.cfg\n## The tool board will use the following configurations,\n## and if the following configurations are used in other configurations, conflicts may occur.\n## [resonance_tester] && [extruder] && [tmc2209 extruder] && [fan] && [heater_fan my_hotend_fan]\n## [probe] && [bltouch] && [stepper_x]\n\n#####################################################################\n#      Master ID Configuration\n#####################################################################\n[mcu sht36v2]\ncanbus_uuid:\n### To query the CAN firmware id: ~/klippy-env/bin/python ~/klipper/scripts/canbus_query.py can0\n### Replace serial with canbus_uuid: and add the id after it\n\n#####################################################################\n#      Temperature monitoring\n#####################################################################\n[temperature_sensor SHT36-V2]\nsensor_type: temperature_mcu\nsensor_mcu: sht36v2\n#--------------------------------------------------------------------\n[temperature_sensor Box]\nsensor_type: ATC Semitec 104GT-2\nsensor_pin = sht36v2:PA4\n#####################################################################\n#      Accelerometer\n#####################################################################\n## https://www.klipper3d.org/Measuring_Resonances.html?h=adxl#adxl345\n[adxl345]\ncs_pin: sht36v2:PA9\nspi_bus: spi2\n#--------------------------------------------------------------------\n[resonance_tester]\naccel_chip: adxl345\nprobe_points: 150, 150, 20\n# Somewhere slightly above the middle of your print bed\nmin_freq: 5\nmax_freq: 133\naccel_per_hz: 75\nhz_per_sec: 1\n\n#####################################################################\n#      Extruder thermal sensitivity\n#####################################################################\n## Please select the type of thermistor you want to use.\n[extruder]\n## Type of sensor - common thermistors are (Generic 3950, ATC Semitec 104GT-2)\nsensor_type: ATC Semitec 104GT-2\nsensor_pin: sht36v2:PA3\n###------------------------------------------------------------------\n## If using PT1000, please connect the jumper next to the thermistor.\n# sensor_type: PT1000\n# pullup_resistor: 1100\n# sensor_pin: sht36v2:PA3\n###------------------------------------------------------------------\n## Using MAX31865 to connect PT100\n# sensor_type: MAX31865\n# sensor_pin: sht36v2:PB12\n# spi_bus: spi2\n# rtd_reference_r: 430\n# rtd_nominal_r: 100  ## Set to 100 for PT100, 1000 for PT1000\n#####################################################################\n#      Extruder\n#####################################################################\n## https://www.klipper3d.org/Config_Reference.html#extruder\n[extruder]\nstep_pin: sht36v2:PB4\ndir_pin: sht36v2:PB3               # Extruder motor direction pin\nenable_pin: !sht36v2:PA15\nrotation_distance: 21.84\n## rotation_distance = The original rotation_distance multiplied by the actual extrusion length divided by the requested extrusion length.\n## Calibration: 22.44 = old value 22 * actual value 102 / target value 100\ngear_ratio: 50:10\n## Gear ratio (Galileo 7.5:1, comment this line; BMG is 50:17, output shaft in front, input shaft in back)\nmicrosteps: 16\nfull_steps_per_rotation: 200\nnozzle_diameter: 0.400\nfilament_diameter: 1.75\nheater_pin: sht36v2:PA8\nmin_temp: -230\nmax_temp: 350\nmax_power: 1.0\nmin_extrude_temp: 150\npressure_advance: 0.05\n## https://www.klipper3d.org/Pressure_Advance.html\npressure_advance_smooth_time: 0.040\n# max_extrude_only_distance: 200.0   # Comment this if you get extrusion flow errors, but it\'s recommended to re-slice\n# Nozzle temperature PID calibration command: "PID_CALIBRATE HEATER=extruder TARGET=245"\ncontrol: pid\npid_kp: 26.213\npid_ki: 1.304\npid_kd: 131.721\nstep_pulse_duration: 0.000004\n#--------------------------------------------------------------------\n[tmc2209 extruder]\nuart_pin: sht36v2:PB5\ninterpolate: False\nrun_current: 0.8\nsense_resistor: 0.110\nstealthchop_threshold: 500\n\n#####################################################################\n#      FAN\n#####################################################################\n[fan]\npin: sht36v2:PB11\n#--------------------------------------------------------------------\n[heater_fan hotend_fan]\npin: sht36v2:PB10\nheater: extruder\nheater_temp: 50.0\n\n#####################################################################\n#      X STOP\n#####################################################################\n# [stepper_x]\n# endstop_pin: !sht36v2:PA2\n## SHT V2 board has PA1 and PA2 endstop pins available, modify according to actual wiring\n## PA1 pin supports high voltage input by default, can be used for 12v proximity sensors, etc. You can configure PA1 as a regular endstop pin with a jumper\n\n#####################################################################\n#      Stealthburner LED\n#####################################################################\n## https://github.com/VoronDesign/Voron-Stealthburner/tree/main\n[neopixel sb_leds]\npin: sht36v2:PB0\nchain_count: 3\n# Number of LEDs\ncolor_order: GRB\ninitial_RED: 0.4\ninitial_GREEN: 0.8\ninitial_BLUE: 1\ninitial_WHITE: 0.0\n# 66CCFF\n\n#####################################################################\n#      TAP && PL08N && BLTOUCH\n#####################################################################\n## https://www.klipper3d.org/Config_Reference.html?h=probe#probe\n# [probe]\n# pin: ^sht36v2:PA1\n# x_offset: 0\n# y_offset: 25.0\n# z_offset: 0\n# speed: 10.0\n# samples: 3\n# samples_result: median\n# sample_retract_dist: 4.0\n# samples_tolerance: 0.010\n# samples_tolerance_retries: 3\n\n#--------------------------------------------------------------------\n## https://www.klipper3d.org/Config_Reference.html?h=probe#bltouch\n# [bltouch]\n# sensor_pin: ^sht36v2:PC15\n# control_pin: sht36v2:PB1\n# x_offset: -26.1\n# y_offset: -15.3\n# z_offset: 2.1\n\n#####################################################################\n#      Magnetic Angle Sensor\n#####################################################################\n## For more information, see https://www.klipper3d.org/API_Server.html#angledump_angle\n## https://www.klipper3d.org/Debugging.html#motion-analysis-and-data-logging\n[angle my_angle_sensor]\nsensor_type: as5047d\n# sample_period: 0.000400\n# stepper: stepper_x\ncs_pin: sht36v2:PC14\nspi_bus: spi1\n\n'})})]})}function p(e={}){let{wrapper:n}={...(0,i.a)(),...e.components};return n?(0,o.jsx)(n,{...e,children:(0,o.jsx)(d,{...e})}):d(e)}},50065:function(e,n,t){t.d(n,{Z:()=>a,a:()=>s});var r=t(67294);let o={},i=r.createContext(o);function s(e){let n=r.useContext(i);return r.useMemo(function(){return"function"==typeof e?e(n):{...n,...e}},[n,e])}function a(e){let n;return n=e.disableParentContext?"function"==typeof e.components?e.components(o):e.components||o:s(e.components),r.createElement(i.Provider,{value:n},e.children)}}}]);